import React, { Component } from "react";
import "./Main.css";
import Booklist from "../Books/Booklist/Index";
import Mainbook from "../Books/Booklist/mainBooks";
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import BookEdit from '../Books/BookEdit/Index'
class Main extends Component {
  render() {
    const {
      books
    } = this.props;
    return (
      <main className="row">
        <BrowserRouter>
          <Switch>
            <Route
              exact
              path="/"
              render={() => {
                return (
                  <Mainbook books={books} />
                )
              }}
            />
            <Route
              path="/book/:id"
              render={props => {
                return (
                  <BookEdit match={props.match} books={books} />
                )
              }}
            />
            <Route
              path="/genre"
              render={() => (
                <Booklist books={books} />
              )}
            />
          </Switch>
        </BrowserRouter>

      </main>
    );
  }
};


export default Main;
